ARE YOU READY?

The final challenge of Project Quilting will be announced today at 12 pm CT! Here are the INCREDIBLE Giveaway sponsors for the Project Quilting 14.6 challenge!!!!
What must you do to be eligible to win one of the fab prizes?

So easy! You have one week to make a quilt or sewing project from start to finish using this prompt, the challenge prompt provided by Trisha (at 12 pm today)!

One Challenge, One Project (from start to finish), One Week!
Then link your project up on my blog! It’s that easy!

